キッチンの足元をハイセンスに♪<BR>
北欧モダンデザインのフォレージ柄キッチンマットです。<BR><BR>

裏面は滑りにくい加工がしてあります。<BR><BR>

サイズ：45cm×180cm
<BR><BR>


<BR><TABLE border="1" width="400" cellpadding="5" cellspacing="0"><TR><TD>【上手なお手入れ方法】<BR>
○お洗濯の際、最初の2～3回はムダ毛が抜けたり多少色落ちすることがありますので、他の洗濯物と別に洗濯してください。<BR> 
○お洗濯される場合、裏をたたいてほこりを出した後、洗濯ネットに入れ洗濯機で丸洗いできますが、手で押し洗いされますと、よりマットが長持ちします。<BR>
○ドライクリーニングは避けてください。<BR>
○お洗濯の際は、ぬるま湯で家庭用洗剤をご使用ください。<BR>
○塩素系漂白剤は使用しないでください。<BR>
○ねじり絞りは避け、陰干しにしてください。<BR>
○乾燥機、アイロンのご使用はおやめください。
</TD></TR></TABLE><BR><BR>

<BR><TABLE border="1" width="400" cellpadding="5" cellspacing="0"><TR><TD>【ご注意】<BR>
○マットはすべる場合がありますのでご注意ください。<BR>
○マットは床のお掃除に使う洗剤、ワックス、水等をよくふきとってからご使用ください。<BR>
○ドラム式洗濯機でのお洗濯は機種により使用できません。洗濯機の取扱説明書の「ご使用上の注意」をよくご覧ください。<BR>
○すべり止めゴムが付いているマットの場合は、長期間敷きつめたままにしておくと床材(特に塩ビフロア)が変色又は密着することがあります。時々床面をふいたり取り外したりしてください。<BR>
○床暖房をご使用の場合、長時間連続で使用しないでください。すべり止めゴムが変色又は密着する恐れがあります。</TD></TR></TABLE><BR><BR>

